let data=await service.pagtions(req.body)
let countPage=data.data.count/3;
return res.status(200).json({
    countPage:countPage,
    data:data.data
})
}
const resgister = async(req, res) =>{

    let data=await service.resgister(req.body)
    return res.status(200).json({
